import React from 'react'
import { Box, Container, Grid } from '@mui/material';

export const Logo = ({logo}) => {
  return (
    <Container maxWidth='xl'>
        <Grid
            item xs={12}
            direction={'column'}
            alignItems={'center'}
            alignContent={'center'}
            justifyContent={'center'}
            sx={{mt:5, mb:5}}
        >
            <Box>
                <img src={logo} height={'auto'} width={'50%'} alt='logoUdeA'/>
            </Box>
        </Grid>
    </Container>
  )
}
